import React, {useState} from "react";
import { Layout, Menu } from 'antd';
import {
  MenuUnfoldOutlined,
  MenuFoldOutlined,
  UserOutlined,
  VideoCameraOutlined,
  UploadOutlined,
} from '@ant-design/icons';
import { Link } from "react-router-dom";
import { Table } from 'antd';

const { Header, Sider, Content } = Layout;

const columns = [
    { title: 'Nama', dataIndex: 'nama', key: 'nama' },
    { title: 'Harga', dataIndex: 'harga', key: 'harga' },
    { title: 'Keterangan', dataIndex: 'ket', key: 'ket' },
    {
      title: 'Action',
      dataIndex: '',
      key: 'x',
      render: () => <a>Delete</a>,
    },
  ];

  const data = [
    {
      key: 1,
      name: 'John Brown',
      age: 32,
      address: 'New York No. 1 Lake Park',
      description: 'My name is John Brown, I am 32 years old, living in New York No. 1 Lake Park.',
    },
    {
      key: 2,
      name: 'Jim Green',
      age: 42,
      address: 'London No. 1 Lake Park',
      description: 'My name is Jim Green, I am 42 years old, living in London No. 1 Lake Park.',
    },
    {
      key: 3,
      name: 'Not Expandable',
      age: 29,
      address: 'Jiangsu No. 1 Lake Park',
      description: 'This not expandable',
    },
    {
      key: 4,
      name: 'Joe Black',
      age: 32,
      address: 'Sidney No. 1 Lake Park',
      description: 'My name is Joe Black, I am 32 years old, living in Sidney No. 1 Lake Park.',
    },
  ];

const Home = () => {
    const [collapsed, setCollapsed] = useState(false)

    const toggle = () => {
    setCollapsed(!collapsed)
    };

    const currentUser = JSON.parse(sessionStorage.data).data
    const token = JSON.parse(sessionStorage.data).token

    console.log(token);
    return (
    <Layout>
        <Sider trigger={null} collapsible collapsed={collapsed}>
          <div className="logo" />
          <Menu theme="dark" mode="inline" defaultSelectedKeys={['/profil']}>
            <Menu.Item key="/profil" icon={<UserOutlined />}>
              Edit Profil
              <Link to="/profil" />
            </Menu.Item>
            <Menu.Item key="/produk" icon={<VideoCameraOutlined />}>
              Tambah Produk
              <Link to="/produk" />
            </Menu.Item>
          </Menu>
        </Sider>
        <Layout className="site-layout">
          <Header className="site-layout-background" style={{ padding: 0 }}>
            {React.createElement(collapsed ? MenuUnfoldOutlined : MenuFoldOutlined, {
              className: 'trigger',
              onClick: {toggle},
            })}
          </Header>
          <Content
            className="site-layout-background"
            style={{
              margin: '24px 16px',
              padding: 24,
              minHeight: 280,
            }}
          >
            <h1>PROFIL</h1>
            Nama: {currentUser.nama} <br/>
            Email: {currentUser.email} <br/>
            Jenis Kelamin: {currentUser.gender} <br/>
            <h1>PRODUK</h1>
            <Table
                columns={columns}
                expandable={{
                expandedRowRender: record => <p style={{ margin: 0 }}>{record.description}</p>,
                rowExpandable: record => record.name !== 'Not Expandable',
                }}
                dataSource={data}
            />,
          </Content>
        </Layout>
      </Layout>
    );
};


export default Home
